import React from "react";
import "./SlickOrderCard.css";

const SlickOrderCard = ({ item }) => {
  return (
    <div className="slide-card-sub">
      <div className="slide-card-child-sub">
        <div className="image">
          <img
            style={{ width: "100px" }}
            src="https://res.cloudinary.com/lmru-test/image/upload/f_auto,q_auto,dpr_1.0,d_photoiscoming.png/elbrus/images/main-new/offer/novyi-god-cat-new-main.jpg"
          />
        </div>
        <div className="content">
          <div className="content-title">
            <h5>{item.title}</h5>
            <p>{item.todo}</p>
          </div>
          <div className="content-actions">
            <button className="btn">В корзину</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SlickOrderCard;
